import React from 'react';
import ReactDOM from 'react-dom';
import { createServer } from 'miragejs'
import { App } from './App';

createServer({
  routes() {
    this.namespace = 'api';
    this.get('/timetable', () => {
      return [
        {
          id: 1,
          title: 'day 1',
          time: 200,
          day: new Date()
        }
      ]
    })

    this.post('/timetable', (schema, request) => {
      const data = JSON.parse(request.requestBody)
    })
  }
})

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
